import React from "react";

const OutputTabs = ({ parsedOutput }) => {
  let parsedData = {};

  // Safely parse JSON
  try {
    parsedData = JSON.parse(parsedOutput);
  } catch (err) {
    console.error("Invalid JSON:", err);
    parsedData = { error: "Invalid data received." };
  }

  // Destructure values with fallback
  const {
    language = "Unknown",
    structure = {},
    status = "No status",
    explanation = "No explanation provided.",
    error,
  } = parsedData;

  return (
    <div className="output">
      <h3>Code Analysis</h3>
      {error ? (
        <p style={{ color: "red" }}>Error: {error}</p>
      ) : (
        <>
          <p><strong>Language:</strong> {language}</p>
          <p><strong>Status:</strong> {status}</p>
          <p><strong>Explanation:</strong> {explanation}</p>
          <pre><strong>Structure:</strong> {JSON.stringify(structure, null, 2)}</pre>
        </>
      )}
    </div>
  );
};

export default OutputTabs;
